import React, {  useState } from 'react';


let cratUser = ({userinfo}) => {
    return (
         userinfo.map((fristName, Emali, phone, city) => {
            {
                return (
                    <div className='cart'>
                    <span>name domain: </span>
                    <ul>
                        <li>fristName: {fristName} </li>
                        <li>Emali:{Emali} </li>
                        <li>phone:{phone} </li>
                        <li>city:{city} </li>
                    </ul>
                </div>
                )
            }
         })
    )
}


export default cratUser
